import { Typography,Grid, TextField, Stack} from '@mui/material';
import { Box } from '@mui/system';
import Button from '@mui/material/Button';
import React from 'react';

function Todo(props) {
    return (
        <div>
            <Grid container>
                 <Grid sx={{border:"1px solid " ,margin:"auto"}} item xs = {1} sm = {12} md = {6} lg = {6} xl ={6}>
                     
                    <Box padding ={2}>
                        <Typography>Add A Task</Typography>
                    </Box>
                    <Box padding={2}>
                    <Stack spacing={2}>
                          <Typography variant ="h5">Add A Task</Typography>
                          <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                          <Typography variant ="body1">Enter what you want to submits</Typography>
                        <Button variant="contained" sx={{width:"20%"}}>Text</Button>
                    </Stack>
                    <Box>
                        {/* <Button variant ="contained" >submit</Button> */}
                    </Box>
                    </Box>



                 </Grid>
            </Grid>
        </div>
    );
}

export default Todo;
